import styled from 'styled-components';

const TrackSide = () => {
    return(
        <Wrapper>
            <Heading>
                Top Tracks
            </Heading>
        </Wrapper>
    )
}
const Wrapper = styled.div``
const Heading = styled.h2`
color:hsl(0, 0%, 39%);
font-size:24px;
font-weight:bold;
`
export default TrackSide;
